    const dipatch = useDispatch()
    const temperaments = useSelector(state => state.temperaments)


    const [input, setInput] = useState({
        image:"",
        name:"",
        temperament:[],
        life_span: "",
        weight: [],
        height: []

    })


    return (
        <div>
            <h2>Create your breeeeeed</h2>
            <form>
                <div>
                    <div>
                        <label>
                            Name:
                        </label>
                        <input
                        type="text"
                        value={input.name}
                        />
                    </div>
                </div>
            </form>
        </div>
    )
};
